import React, {Component} from 'react'
import classes from './mobile.css';

class mobile extends Component {
    constructor(props)
    {
        super(props);
        this.name = "samsung";
    }


    render()
    {
        return <h1 style = { this.state }
                   onClick = {this.getClick.bind(this)}>
               {this.props.title} </h1>
    }
} 

export default mobile;
